import React, { Component } from 'react';
import './App.css';
import Landing from './Landing';
import Skills from './Skills';
import About from './About';
import Grid from './Grid';
import Tabs from './Tabs';
import Log from './Log';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Landing/>
        <Skills/>
        <Grid/>
        <Log/>
        <Tabs/>

        <About/>
      </div>
    );
  }
}

export default App;
